import React, { Component } from 'react';
import './section1.css';
import image from "../assets/images/GGR28449.jpg";

class Section1 extends Component {
  render() {
        const skills = this.props.data.skills;
        const listSkills = skills.map((skill) =>
            <li>{skill.description}</li>
        );
        const Languages = this.props.data.Languages;
        const listLanguages = Languages.map((Language) =>
            <li>{Language.Language}</li>
        );
    return (
        <div className ="Section1">
            <div className="img">
                <img src={image}></img>
            </div>

            <div className ="bio">
                <span className="subtitle">PERFIL</span>
                <hr></hr>
                <label>{this.props.data.bio.description}</label>
            </div>

            <div className="contact">
                <span className="subtitle">CONTACTO</span>
                <hr></hr>
                <div>{this.props.data.personal_information.phone}</div>
                <div>{this.props.data.personal_information.mail}</div>
                <div>{this.props.data.personal_information.direction}</div>
            </div>

            <div className ="skills">
                <span className="subtitle">HABILIDADES</span>
                <hr></hr>
                <ul>
                   {listSkills}
                </ul>
            </div>

            <div className ="Languages">
                <span className="subtitle">IDIOMAS</span>
                <hr></hr>
                <ul>{listLanguages}</ul>
                {/* <label>{this.props.data.bio.description}</label> */}
            </div>

        </div>
    )
  }
}

export default Section1
